  \"2015-03-16T16:58:59.764771\",\n\t\"name\": \"district-cohort-graduation-rates-2013\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains the 2013 four-year
  cohort graduation rates by district. rnThe Connecticut State Department of Education
  (CSDE) introduced the four-year cohort graduation rate with the graduating class
  of 2009. This approach was created when Connecticut and 49 other states signed an
  agreement with the National Governorsu2019 Association to develop a uniform system
  for tracking students.  The four-year cohort graduation rate is calculated by tracking
  an individual cohort, or group of students, from their initial entrance into Grade
  9 through to graduation. The four-year cohort graduation rate represents the percentage
  of students who earn a standard high school diploma within four years. The calculation
  uses individual student-level data from the state's Public School Information System
  (PSIS) that school districts submitted and superintendents certified.rnrnNotes:
  rnDouble plus symbol (u2020u2020) denotes not applicable; rnAsterisk symbol (*)
  denotes fewer than six in a cohort is suppressed;rnOut-placed students are counted
  only in district graduation calculation;rnRow percentages may not add to 100 percent
  because of rounding;rnDistrict graduation rates may not be the same as the average
  of the graduation rates of the number schools in that district because of out-placed
  students.rnrnGov. Malloy: Graduation Rate Increases for Fourth Consecutive Year:
  http://www.governor.ct.gov/malloy/cwp/view.asp?A=4010&Q=545016rnrnCohort Graduation
  Rate Documentation:rnhttp://www.sde.ct.gov/sde/lib/sde/PDF/EvalResearch/cohortgraddocumentation.pdf\",\n\t\"license_title\":
